We passed walls of bales upon bales of hay and I realised the bales of hay often could not be sold due to border restrictions... There's many a case of farmers not eligible for approval to transport the bales across the NSW-Victoria border to buyers... They were informed the only way to get the hay bales across the border was to transport them from the farms in country NSW to Sydney, fly the bales to Melbourne, then transport it to country Victoria!  What was supposed to be a 1-2 hour job of transporting the hay by trucks to be sold then became up to a week of additional transport stress and extra cost... It's bad enough dealing with the drought that has cost many farmers and their families their livelihood built on blood, sweat and tears... And now, this!
They were not the only ones going through this nonsense!  I'm not even going to start on the issues caused to people who needed to cross the border for medical assistance and were refused entry except to say one incident lead to the passing of an innocent baby... What happened to empathy, care and common sense?  Sadly a life was lost due to nonsensical bureaucracy... Since these horrible incidents have occured, the government has become a tad bit sensible enough to allow people staying at the borders limited access to cross over for medical needs and business... I wished they had come to their senses earlier... May the little one rest in peace and may this never happen again... üôèüèªüá¶üá∫‚ù§Ô∏è
